	(1, 'pakaian pria', 'https://down-id.img.susercontent.com/file/id-11134207-7rasi-m1rsjne44omp1c@resize_w900_nl.webp', 'Kemaja Pria Hitam Premium', 'Temukan kesan elegan dan timeless dengan kemeja lengan panjang pria warna hitam ini. Terbuat dari bahan berkualitas tinggi, kemeja ini tidak hanya nyaman dipakai, tetapi juga memberikan tampilan yang rapi dan profesional. Desain klasiknya membuatnya sempurna untuk berbagai acara, mulai dari pertemuan bisnis hingga acara santai bersama teman. Dengan detail jahitan yang rapi dan potongan yang pas, kemeja ini adalah pilihan ideal bagi pria yang ingin tampil stylish tanpa mengorbankan kenyamanan.', 40, '91000', 'https://shopee.co.id/Kemaja-Pria-Hitam-Premium-i.1227591982.28115434030?sp_atk=fc310359-3763-4989-b2d5-8c03840209a5', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
