	(3, 'pakaian pria', 'https://down-id.img.susercontent.com/file/id-11134207-7rasl-m1h1uz0697f3e0@resize_w900_nl.webp', 'Kemeja Printing Pria Mallevic MLV 639', 'Kemeja Printing MLV 639\nPilih koleksi pakaian kamu dari brand ideathings karena dibuat dari bahan yang berkualitas dan design yang kekinian, sangat cocok menemani aktivitas keseharian kamu. Berbahan katun rayon, akan sangat nyaman dan tidak panas saat digunakan. Dengan detail kemeja yang unik, membuat kalian terlihat fresh dan fashionable.\nSize Chart :\nM : Panjang 71cm x Lebar 50cm x Lingkar Dada 100cm x Panjang Lengan 21cm\nL : Panjang 72cm x Lebar 52cm x Lingkar Dada 104cm x Panjang Lengan 22cm\nXL : Panjang 73cm x Lebar 54cm x Lingkar Dada 108cm x Panjang Lengan 23cm', 25, '92812', 'https://shopee.co.id/Kemeja-Printing-Pria-Mallevic-MLV-639-i.1227591982.27564336550?sp_atk=213ae3c7-69d1-4219-b399-a8776ee8ab02', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(4, 'pakaian wanita', 'https://down-id.img.susercontent.com/file/id-11134207-7rasb-m1o5aoddg62h3d@resize_w900_nl.webp', 'Celana Blue Jeans Wanita Casual dan Elegan', 'Celana jeans wanita ini merupakan pilihan sempurna untuk meningkatkan gayamu harian dengan sentuhan elegan dan kasual. Terbuat dari bahan denim berkualitas tinggi, celana ini menawarkan ketegaran dan fleksibilitas yang memungkinkan Anda bergerak dengan leluasa. Desain klasik dengan potongan yang modern membuatnya cocok dipadukan dengan berbagai atasan, dari blus polos sampai sweater hangat. Dengan warna yang menarik, biru gelap.\nSiap untuk menambah koleksi pakaian Anda? Celana jeans ini tidak hanya nyaman tetapi juga tahan lama. Bahan yang digunakan dirancang untuk resistensi air dan gesekan minimal, sehingga Anda dapat menggunakannya dalam berbagai situasi, dari acara formal hingga santai di rumah. Beli sekarang dan nikmati kenyamanan serta gaya yang maksimal dengan celana jeans wanita!', 25, '216000', 'https://shopee.co.id/Celana-Blue-Jeans-Wanita-Casual-dan-Elegan-i.1227591982.29614906577?sp_atk=0444d2d5-67f7-48dc-857b-ca9de4a1abf3', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
