	(6, 'pakaian wanita', 'https://down-id.img.susercontent.com/file/id-11134207-7r98y-lx0xybzynwa20d@resize_w900_nl.webp', 'Jacket Wanita KSD KZR 515', 'Produk asli 100% buatan Indonesia, berasal dari Bandung yang sudah dikenal sebagai pusat mode. Terbuat dari bahan yang berkualitas dan diolah pengrajin terbaik. Dirancang dengan desain yang update menjadikan penampilan lebih trendy.', 25, '170000', 'https://shopee.co.id/Jacket-Wanita-KSD-KZR-515-i.1227591982.27153874408?sp_atk=316c7e59-00ef-47b0-9ab1-c7e098a70c1a', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
