	(14, 'pakaian pria', 'https://down-id.img.susercontent.com/file/id-11134207-7r98r-lyq33qq5163s91.webp', 'Baju Salur Pria Amry lD SW 250', 'Hallo kk... Kali ini kita memperkenalkan produk baru yang lagi hits dan kekinian dari Amry ID . Baju Salur Pria Amry ID SW 250. Baju salur ini dibuat menggunakan bahan CVC. \n\nBahan CVC \nKarakteristik dari bahan cvc masuk dalam kategory bahan kuat dan halus Ciri dari bahan cvc selanjutnya adalah teksturnya halus serat kain nya yang lebih kecil dan juga tebal. Serta memiliki daya serap yang baik sehingga nyaman digunakan. \n\nBaju ini sangat cocok digunakan dalam berbagai kegiatan anda dalam mode casual. Dengan model dan warna yang menarik menjadikan tampil lebih percaya diri. \n\nDalam proses produksi kami sangat memperhatikan kualitas jahitan dan bahan serta pemilihan motif yang kekinian , sehingga untuk bahan Amry ID sangat kuat, tidak mudah jebol dan kekinian pastinya. \n\nPastikan produk Amry ID ada di list koleksi kalian yah, karena banyak produk-produk best seller di toko kami. Happy Shopping', 5, '93103', 'https://shopee.co.id/Baju-Salur-Pria-Amry-lD-SW-250-i.1227591982.27357452052?sp_atk=43b84a3f-d7cd-482b-859c-7a1ca572bc9f', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(15, 'pakaian pria', 'https://down-id.img.susercontent.com/file/id-11134207-7r98v-lwcvh0mleomi8b.webp', 'Hoodie H&M The Beatles', 'H&M hoodie The Beatles White\nREADY STOCK Surabaya\nSize S M L\nOriginal reject pabrik\nBrand new!!\n\nSIZE CHART HOODIE H&M\n.\nP x L\nSIZE:\nS - 66 x 50cm\nM - 70 x 53cm\nL - 72 x 56cm \nXL - 75 x 60cm\n.\nToleransi 1-2 cm', 100, '176000', 'https://shopee.co.id/Hoodie-H-M-The-Beatles-i.1227591982.29402329232?sp_atk=05cc3010-63cd-4bda-aa73-769ef104b8dd', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
